	public static int maximumEnergy(int[] energy, int k) {
		int power = Integer.MIN_VALUE, max = Integer.MIN_VALUE;
		for (int i = 0; i < energy.length; i++) {
			power = energy[i];
			for (int j = i + k; j < energy.length; j += k) {
				power += energy[j];

			}
			max = Math.max(power, max);
		}
		return max;
	}
